/* GBR_QosInformation_iE_Extensions */

GBR_QosInformation_iE_Extensions_element* 
   asn1Get_GBR_QosInformation_iE_Extensions (ProtocolExtensionID id, 
   GBR_QosInformation_iE_Extensions* plist)
{
   if (0 != plist && plist->count > 0) {
      OSRTDListNode* pNode = plist->head;
      GBR_QosInformation_iE_Extensions_element* pElem;
      while (0 != pNode) {
         pElem = (GBR_QosInformation_iE_Extensions_element*) pNode->data;
         if (pElem->id == id) return pElem;
         pNode = pNode->next;
      }
   }
   return 0;
}

int asn1GetAll_GBR_QosInformation_iE_Extensions 
   (OSCTXT* pctxt, ProtocolExtensionID id, 
   GBR_QosInformation_iE_Extensions* plist, 
   GBR_QosInformation_iE_Extensions* pmatches)
{
   if (0 != plist && plist->count > 0) {
      OSRTDListNode* pNode = plist->head;
      GBR_QosInformation_iE_Extensions_element* pElem;
      while (0 != pNode) {
         pElem = (GBR_QosInformation_iE_Extensions_element*) pNode->data;
         if (pElem->id == id)  {
            if (!rtxDListAppend(pctxt, pmatches, pElem))
               return LOG_RTERR(pctxt, RTERR_NOMEM);
         }
         pNode = pNode->next;
      }
   }
   return 0;
}

