LocationReportingRequestType_iE_Extensions_element* 
   asn1Get_LocationReportingRequestType_iE_Extensions (ProtocolExtensionID id, 
   LocationReportingRequestType_iE_Extensions* plist)
{
   if (0 != plist && plist->count > 0) {
      OSRTDListNode* pNode = plist->head;
      LocationReportingRequestType_iE_Extensions_element* pElem;
      while (0 != pNode) {
         pElem = (LocationReportingRequestType_iE_Extensions_element*) pNode->data;
         if (pElem->id == id) return pElem;
         pNode = pNode->next;
      }
   }
   return 0;
}

int asn1GetAll_LocationReportingRequestType_iE_Extensions 
   (OSCTXT* pctxt, ProtocolExtensionID id, 
   LocationReportingRequestType_iE_Extensions* plist, 
   LocationReportingRequestType_iE_Extensions* pmatches)
{
   if (0 != plist && plist->count > 0) {
      OSRTDListNode* pNode = plist->head;
      LocationReportingRequestType_iE_Extensions_element* pElem;
      while (0 != pNode) {
         pElem = (LocationReportingRequestType_iE_Extensions_element*) pNode->data;
         if (pElem->id == id)  {
            if (!rtxDListAppend(pctxt, pmatches, pElem))
               return LOG_RTERR(pctxt, RTERR_NOMEM);
         }
         pNode = pNode->next;
      }
   }
   return 0;
}

